import { Box, Grommet, Main } from 'grommet';

const LoginPage = () => (
  <Grommet>
    <Main
      direction="row"
      border={{ color: 'brand', size: 'large' }}
      pad="medium"
    >
      <Box pad="medium" background={{
              "color": "neutral-1",
              "dark": true,
              "opacity": true,
              "position": "bottom",
              "repeat": "no-repeat",
              "size": "cover",
              "image": "src(../assets/berries.jpg)"}
      } />
      <Box pad="small" background="light-3" />
    </Main>
  </Grommet>
)

export default LoginPage;
